webpackJsonp([61853811074710],{668:function(e,n){e.exports={data:{markdownRemark:{html:'<p>The “node” is the center of Gatsby’s data system. All data that’s added to\nGatsby is modeled using nodes.</p>\n<p>The basic node data structure is as follows:</p>\n<div class="gatsby-highlight">\n      <pre class="language-flow"><code>id: String,\nchildren: Array[String],\nparent: String,\n// Reserved for plugins who wish to extend other nodes.\nfields: Object,\ninternal: {\n  contentDigest: String,\n  // Optional media type (https://en.wikipedia.org/wiki/Media_type) to indicate\n  // to transformer plugins this node has data they can futher process.\n  mediaType: String,\n  // A globally unique node type choosen by the plugin owner.\n  type: String,\n  // The plugin which created this node.\n  owner: String,\n  // Stores which plugins created which fields.\n  fieldOwners: Object,\n  // Optional field exposing the raw content for this node\n  // that transformer plugins can take and further process.\n  content: String,\n}\n...other fields specific to this type of node</code></pre>\n      </div>\n<h2 id="source-plugins"><a href="#source-plugins" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Source plugins</h2>\n<p>New nodes are added to Gatsby by “source” plugins. A common one that many Gatsby\nsites use is the <a href="/packages/gatsby-source-filesystem/">Filesystem source plugin</a>\nwhich turns files on disk into File nodes.</p>\n<p>Other source plugins pull data from external APIs such as the\n<a href="/packages/gatsby-source-drupal/">Drupal</a> and\n<a href="/packages/gatsby-source-hacker-news/">Hacker News</a></p>\n<h2 id="transformer-plugins"><a href="#transformer-plugins" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Transformer plugins</h2>\n<p>Transformer plugins can also create nodes by transforming source nodes into new\ntypes of nodes. It is very common when building Gatsby sites to install both\nsource plugin(s) and transformer plugins.</p>\n<p>Nodes created by transformer plugins are set as “children” of their “parent”\nnodes.</p>\n<ul>\n<li>The\n<a href="/packages/gatsby-transformer-remark/">Remark (Markdown library) transformer plugin</a>\nlooks for new nodes that are created with a <code>mediaType</code> of <code>text/markdown</code> and\nthen transforms these nodes into <code>MarkdownRemark</code> nodes with an <code>html</code> field.</li>\n<li>The <a href="/packages/gatsby-transformer-yaml/">YAML transformer plugin</a> looks for\nnew nodes with a media type of <code>text/yaml</code> (e.g. a <code>.yaml</code> file) and creates\nnew YAML child node(s) by parsing the YAML source into JavaScript objects.</li>\n</ul>\n<h2 id="graphql"><a href="#graphql" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>GraphQL</h2>\n<p>Gatsby automatically infers the structure of your site’s nodes and creates a\nGraphQL schema which you can then query from your site’s components.</p>',excerpt:"The “node” is the center of Gatsby’s data system. All data that’s added to\nGatsby is modeled using nodes. The basic node data structure is…",timeToRead:2,frontmatter:{title:"Node Interface"},parent:{__typename:"File",relativePath:"docs/node-interface.md"}}},pathContext:{slug:"/docs/node-interface/"}}}});
